                مشخص
            </h1>
            <p class="text-white fw-medium w-75">
            در دنیای امروزی که تکنولوژی با سرعت نور در حال پیشرفت است، یادگیری برنامه‌نویسی بک‌اند می‌تواند شما را به فرصت‌های بی‌شماری متصل کند. در این نقشه راه، ما شما را گام به گام از مفاهیم پایه‌ای تا پیشرفته‌ترین تکنیک‌ها هدایت خواهیم کرد.
            </p>
